      <div className="container mx-auto">
        <div className="flex flex-col justify-center items-start">
          <h1 className="px-8 py-2 text-4xl font-bold tracking-wider">
            BEARBRICK Database
          </h1>
        </div>
        <Box sx={{ flexGrow: 1 }}>
          <Grid container spacing={2}>
            <Grid item xs={6} md={8}>
              <div>xs=6 md=8</div>
            </Grid>
            <Grid item xs={6} md={4}>
              <div>xs=6 md=4</div>
            </Grid>
            
