        </Box>
        <div className="">
          <input
            type="text"
            placeholder="Search"
            value={searchTerm}
            onChange={handleSearch}
            className="w-4/5 h-12 pl-10 pr-12 border border-gray-400 rounded-xl focus:outline-none focus:ring-2 focus:ring-gray-400 focus:border-transparent"
          />
          {/* <IoIosSearch className="absolute top-4 left-4 text-gray-500" /> */}
        </div>
      </div>

      {/* <input
                    type="text"
                    placeholder="Search"
