                    className="w-4/5 h-12 pl-10 pr-32 border border-gray-400 rounded-xl focus:outline-none focus:ring- focus:ring-gray-400 focus:border-transparent"
                    /> */}

      {/* <IoIosSearch className="absolute top-4 left-3 text-gray-500" />
                    {searchTerm && (
                        <button
                        className="absolute top-4 right-6 text-gray-400"
                        onClick={handleClearSearch}
                        >
                        <FaTimes />
                        </button>
                    )} */}

      {/* <button
                    onClick={handleAddItem}
                    className="w-28 h-12 bg-white text-black px-4 py-2 rounded-xl ml-2"
                    >
                    Add Item
                    </button> */}
    </main>
  );
}
